import React from 'react';
import Select from 'react-select';
import ingredientsDB from './Ingredients';
import ingredientCategories from './IngredientCategories';

export default function IngredientRow({ index, line, onChange, onRemove }) {
  const handleChange = (field, value) => {
    onChange(index, field, value);
  };

  const subcategories =
    ingredientCategories.find((cat) => cat.category === line.category)?.subcategories || [];

  const filteredIngredients = ingredientsDB.filter(
    (i) => i.subcategory === line.subcategory
  );

  const ingredient = ingredientsDB.find((i) => i.id === line.ingredientId);
  const cost = ingredient ? `$${(ingredient.apCost || 0).toFixed(2)}` : '';

  const ingredientOptions = filteredIngredients.map((ing) => ({
    value: ing.id,
    label: ing.name,
  }));

  return (
    <div className="flex gap-2 items-center mb-2">
      <input
        type="number"
        placeholder="Qty"
        className="w-[54px] h-[28px] text-sm border-b border-gray-300 pl-[5px]"
        value={line.qty}
        onChange={(e) => handleChange('qty', e.target.value)}
      />

      <select
        className="w-[54px] h-[28px] text-sm border-b border-gray-300 text-gray-500 pl-[5px]"
        value={line.unit}
        onChange={(e) => handleChange('unit', e.target.value)}
      >
        <option value="g">g</option>
        <option value="oz">oz</option>
        <option value="ea">ea</option>
        <option value="qts">qts</option>
      </select>

      <select
        className="h-[28px] text-sm border-b border-gray-300 text-gray-500 pl-[5px]"
        value={line.category || ''}
        onChange={(e) => handleChange('category', e.target.value)}
      >
        <option value="">Select Category</option>
        {ingredientCategories.map((cat) => (
          <option key={cat.category} value={cat.category}>{cat.category}</option>
        ))}
      </select>

      <select
        className="h-[28px] text-sm border-b border-gray-300 text-gray-500 pl-[5px]"
        value={line.subcategory || ''}
        onChange={(e) => handleChange('subcategory', e.target.value)}
      >
        <option value="">Select Subcategory</option>
        {subcategories.map((sub) => (
          <option key={sub} value={sub}>{sub}</option>
        ))}
      </select>

      <div className="w-[220px] text-sm flex items-center h-[28px]">
        <Select
          classNamePrefix="react-select"
          placeholder="Select Ingredient"
          options={ingredientOptions}
          value={ingredientOptions.find((opt) => opt.value === line.ingredientId) || null}
          onChange={(selected) => handleChange('ingredientId', selected ? selected.value : '')}
          styles={{
            container: (base) => ({ ...base, width: '100%' }),
            control: (base) => ({
              ...base,
              minHeight: '28px',
              height: '28px',
              borderRadius: 0,
              borderColor: '#D1D5DB',
              boxShadow: 'none',
              paddingLeft: '5px',
              fontSize: '0.875rem',
              alignItems: 'center'
            }),
            indicatorsContainer: (base) => ({ ...base, height: '28px' }),
            dropdownIndicator: (base) => ({ ...base, padding: '4px' }),
            valueContainer: (base) => ({ ...base, height: '28px', padding: '0 4px' }),
            input: (base) => ({ ...base, margin: 0, padding: 0 })
          }}
        />
      </div>

      <input
        type="text"
        placeholder="Modifier"
        className="w-[150px] h-[28px] text-sm border-b border-gray-300 font-light pl-[5px] text-gray-500"
        value={line.modifier || ''}
        onChange={(e) => handleChange('modifier', e.target.value)}
      />

      <span className="text-sm text-gray-700 w-[80px]">{cost}</span>

      <button
        className="text-red-500 hover:text-red-700 text-sm ml-2"
        onClick={() => onRemove(index)}
      >
        Remove
      </button>
    </div>
  );
}
